import React from 'react'

function OftenOrder({List}) {
  const oftenOrder = 'Часто заказывают'
  
  return (
    <div>
      <h1>{oftenOrder}</h1>
       {List.map(miniCard => 
       <div key={miniCard.id}>
       <img src={miniCard.img} alt="img" />
        <h1>{miniCard.name}</h1>
        <h3>{miniCard.price}</h3>
       </div>)}
    </div>
  )
}

export default OftenOrder
